  1-meter sidescan-sonar mosaic image collected by the U.S. Geological Survey along
  the Delmarva Peninsula, MD and VA in 2015 (8-bit GeoTIFF, UTM Zone 18N, WGS 84)\",\n\t\"tracking_summary\":
