  [],\n\t\"revision_timestamp\": \"2016-02-03T02:45:58.220210\",\n\t\"name\": \"preliminary-1-meter-sidescan-sonar-mosaic-image-collected-by-the-u-s-geological-survey-along-84\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Delmarva Peninsula is a 220-kilometer-long
  headland, spit, and barrier island complex that was significantly affected by Hurricane
  Sandy in the fall of 2012. The U.S. Geological Survey conducted cruises during the
  summers of 2014 and 2015 to map the inner continental shelf of the Delmarva Peninsula
  using geophysical and sampling techniques to define the geologic framework that
  governs coastal system evolution at storm-event and longer timescales. Geophysical
  data collected during the cruises include swath bathymetric, sidescan sonar, chirp
  and boomer seismic reflection profiles, grab sample and bottom photograph data.
  Preliminary datasets of backscatter and bathymetry from the 2015 survey are released
  here to the public and collaborators while final datasets for all data collected
  in 2015 will be released in 2016. More information about the USGS survey conducted
  as part of the Hurricane Sandy Response-- Geologic Framework and Coastal Vulnerability
  Study can be found at the project website or on the WHCMSC Field Activity Web pages:
  http://woodshole.er.usgs.gov/project-pages/delmarva/, http://cmgds.marine.usgs.gov/fan_info.php?fan=2015-001-FA
  and http://cmgds.marine.usgs.gov/fan_info.php?fan=2015-001-FA. Data collected during
  the 2014 survey can be obtained here: http://dx.doi.org/10.5066/F7MW2F60\",\n\t\"license_title\":
